var example={ext_name:'example',first_time:true,CMD1:0};function example_main(){ext_switch_to_client(example.ext_name,example.first_time,example_recv);if(!example.first_time)
example_controls_setup();example.first_time=false;}
function example_recv(data){var firstChars=arrayBufferToStringLen(data,3);if(firstChars=="DAT"){var ba=new Uint8Array(data,4);var cmd=ba[0];if(cmd==example.CMD1){}else{console.log('example_recv: DATA UNKNOWN cmd='+cmd+' len='+(ba.length-1));}
return;}
var stringData=arrayBufferToString(data);var params=stringData.substring(4).split(" ");for(var i=0;i<params.length;i++){var param=params[i].split("=");if(1&&param[0]!="keepalive"){if(isDefined(param[1]))
console.log('example_recv: '+param[0]+'='+param[1]);else
console.log('example_recv: '+param[0]);}
switch(param[0]){case"ready":example_controls_setup();break;case"example_command_cmd2":var arg=parseInt(param[1]);console.log('example_recv: cmd2 arg='+arg);break;default:console.log('example_recv: UNKNOWN CMD '+param[0]);break;}}}
function example_controls_setup(){var data_html=time_display_html('example')+
w3_div('id-example-data scale|left:150px; width:1024px; height:200px; background-color:white; position:relative;','example extension HTML in ext-data-container');var controls_html=w3_div('id-example-controls w3-text-white','example extension HTML in ext-controls-container');ext_panel_show(controls_html,data_html,null);time_display_setup('example');example_environment_changed({resize:1});}
function example_environment_changed(changed){if(!changed.resize)return;var el=w3_el('id-example-data');var left=(window.innerWidth-1024-time_display_width())/ 2;el.style.left=px(left);}
function example_focus(){}
function example_blur(){}
function example_help(show){if(show){var s=w3_text('w3-medium w3-bold w3-text-aqua','Example help')+
w3_div('w3-margin-T-8 w3-scroll-y|height:90%',w3_div('w3-margin-R-8','...'));confirmation_show_content(s,610,350);w3_el('id-confirmation-container').style.height='100%';}
return true;}
function example_config_html(){ext_config_html(example,'example','Example','Example configuration','');}



